from project import app
import unittest
from flask import json

class FlaskTestCase(unittest.TestCase):
            
    def test_empty_image_string(self):
        tester=app.test_client(self)
        response = tester.post('/upload',data=json.dumps({"image":"","type":"back"}),content_type='application/json')
        self.assertEqual( {'Message': 'image string is empty'},response.get_json())

    def test_no_type_part(self):
        tester=app.test_client(self)
        response = tester.post('/upload',data=json.dumps({"image":"b'hdhjdjd'"}),content_type='application/json')
        self.assertEqual({'error': 'no type part'},response.get_json())   

    def test_no_image_part(self):
        tester=app.test_client(self)
        response = tester.post('/upload',data=json.dumps({"type":"front"}),content_type='application/json')
        self.assertEqual({'error': 'no image part'},response.get_json()) 

