    def test_only_post_request(self):
        tester=app.test_client(self)
        response = tester.get('/upload',data=json.dumps({"image":"","type":"front"}),content_type='multipart/form-data')
        self.assertEqual({'error': 'only POST requests are allowed'},response.get_json())
    
    def test_invalid_image_string(self):
        tester=app.test_client(self)
        response = tester.post('/upload',data=json.dumps({"image":"sxssdcd","type":"front"}),content_type='application/json')
        self.assertEqual({'error': 'something went wrong, please check the image string'},response.get_json())
    
